import React, {ReactNode} from "react";

class Proposal extends React.Component<any, any> {
    public render(): ReactNode {
        return (
            <div
                style={{
                    border: '1px solid black',
                }}
                className={'p-2'}
            >Proposal</div>
        );
    }
}

export default Proposal;
